import User from "./User";

function Person() {
  return (
    <div className="row">
      <div className="header">header</div>
      <div className="content">
        <User info="this is pic1" />
        <User info="this is pic2" />
        <User info="this is pic3" />
        <User Btn="" />
      </div>
      <div className="footer">footer</div>
    </div>
  );
}
export default Person;
